            <div className="pt-info-detail">
                患者番号-枝番<br></br>
                フリガナ<br></br>
                氏名<br></br>
                保険種別<br></br>
                保険割合<br></br>
            </div>
            <div className="calender">施術日</div>
            <div className="se-info"></div>
        </div>
    );
}
